import React from "react";
const Navegacao = () =>{
    return(
        <ul>
            <li><a href="#">Home</a></li>
            <li><a href="#">Fronted</a></li>
            <li><a href="#">Programacao</a></li>
            <li><a href="#">Design</a></li>
            <li><a href="#">Catalogo</a></li>
        </ul>
    );
};

export default Navegacao;
